import React from "react";

function Analytics() {
  return (
    <div>
      <p
        style={{
          color: "#5076FF",
          fontWeight: "600",
          fontSize: "2.5em",
          textAlign: "center",
          marginTop: "10vh",
        }}
      >
        Quiz Analysis
      </p>
      <p><span>S.No</span><span>Quiz Name </span></p>
    </div>
  );
}

export default Analytics;
